// RemoveCategory relationship.
// Sets o.R.Category to nil.
// Removes o from all passed in related items' relationships struct.
func (o *Skill) RemoveCategory(ctx context.Context, exec boil.ContextExecutor, related *SkillCategory) error {
	var err error

	queries.SetScanner(&o.CategoryID, nil)
	if _, err = o.Update(ctx, exec, boil.Whitelist("category_id")); err != nil {
		return errors.Wrap(err, "failed to update local table")
	}

	if o.R != nil {
		o.R.Category = nil
	}
	if related == nil || related.R == nil {
		return nil
	}

	for i, ri := range related.R.CategorySkills {
		if queries.Equal(o.CategoryID, ri.CategoryID) {
			continue
		}

		ln := len(related.R.CategorySkills)
		if ln > 1 && i < ln-1 {
			related.R.CategorySkills[i] = related.R.CategorySkills[ln-1]
		}
		related.R.CategorySkills = related.R.CategorySkills[:ln-1]
		break
	}
	return nil
}

